   //  position: absolute;\n    //  left: 50%;\n    //  top: 50%;\n    //  width: 350px;\n    //  height: 320px;\n    //  background: url('images/guide-circle.png') center bottom no-repeat;\n    //  transform: translate(-180px, -200px);\n    //  color: #fff;\n    //  font-size: 36px;\n    //  text-align: center;\n    //}\n    &::after {\n      content: '';\n      position: absolute;\n      left: 50%;\n      top: 50%;\n      width: 180px;\n      height: 180px;\n      background: url('images/guide-pointer.png') no-repeat;\n      transform: translate(-50px, -20px);\n    }\n  }\n}\n\n.focus-list {\n  position: relative;\n}\n\n.focusStyle0 {\n  .focus {\n    background-color: rgba(0, 0, 0, 0);\n    // opacity: 0;\n    z-index: 3;\n    //&::before,\n    //&::after {\n    //  content: '';\n    //  position: absolute;\n    //  top: 50%;\n    //  left: 50%;\n    //  width: 41px;\n    //  height: 41px;\n    //  margin: -20.5px 0 0 -20.5px;\n    //  background: url(./images/sceneExploration/normalTips_bg.png) center / contain no-repeat;\n    //  transform: scale(0.8);\n    //  opacity: 0;\n    //  transition: opacity 0.2s;\n    //}\n\n    //&:before {\n    //  animation: focusStyle2_normal_external 1s forwards linear infinite;\n    //}\n    //&:after {\n    //  animation: focusStyle2_normal_inward 0.5s forwards linear infinite alternate;\n    //}\n\n    .marker-animation {\n      position: absolute;\n      left: 50%;\n      top: 50%;\n      width: 110px;\n      height: 110px;\n      transform: translate(-55px, -55px);\n    }\n\n    .guide-key-button {\n      position: absolute;\n      left: 50%;\n      top: 50%;\n      width: 110px;\n      height: 110px;\n      transform: translate(-55px, -55px);\n    }\n\n    .guide-click {\n      pointer-events: none;\n      opacity: 0;\n      transition: opacity 0.2s;\n\n      &::before {\n        content: '点击拾取道具';\n        position: absolute;\n        left: 50%;\n        top: 50%;\n        //width: 300px;\n        //height: 340px;\n      