f6dfa2d26c62:"好的。",CAPTION_cf8d9042aa7c2c4886c1d977345d033b:"社长请。",CAPTION_b9f6ea375305596575020df7a354ee97:"哎呦！吓我一跳，突然拍我一下，你在这干嘛呢？",CAPTION_aaeea116c63e2aa03a8679d14eb36292:"找你半天了，刚刚，跟哪躲着呢？",CAPTION_9dc852f4e8667325ca47f9e72cabd2ac:"刚刚？我想想啊。",CAPTION_851d022b9aee31307f8f07db9cbfb107:"服了，别想了，我问你个事儿。",CAPTION_44a9f4ddf847daaad5f5a1501308a935:"你说。",CAPTION_25d18c388e28b168a87aaa1a7f0d4d0d:"你......说话还算数不？",CAPTION_b242c5b62f302e8efc063dc0b02bb034:"我说啥了？",CAPTION_6fde67c675d94beac2a9aeb117fea54f:"加入。",CAPTION_0f932d8fb00593da3bd5f4c1ee0e8d76:"你同意了？",CAPTION_e4172e6150c140dfa0549d8ce290ddfb:"什么就我同意了，我是说，你说的，问我要不要加入的事儿，还算数不？",CAPTION_6b86005098405c64f9cd70015fae6fd4:"哦，是我说的。",CAPTION_5da876292d22d63b63b7601631ae260a:"我……",CAPTION_09d85bd273265acdd8ddb02e15a5f2e2:"我加入……",CAPTION_cb24101e74fc4583594e92655a2fd501:"你有病啊，松开。",CAPTION_d553589e9f239af269fb05ad32e08c47:"嘿嘿......逗你玩的。",CAPTION_e8e2e5d57debb60cd0c336ff795f7cdf:"好啊你！",CAPTION_ed56f0d9572fb179a689b9b7b7bda007:"刚装疯卖傻耍我！",CAPTION_1f0b6318b6718e254ebade58e97050f9:"嘿嘿。",CAPTION_2020714978c97d5b1babba85438832c8:"你说......你之前是不是一直，跟我面前装傻？",CAPTION_9fece5cdd5638ffcc716017924da9c4b:"我不说。",CAPTION_a83b2122c6f7d3ace1ce4235146d8dfc:"你……你真行。",CAPTION_bc83f9029d7012bd1c5bdfe9cd7afc0f:"我之前跟你说的时候，你发那么大的脾气，现在，想通了？",CAPTION_207afd1523f22d79c22096aca7b2f72e:"说实话，我一天都待不下去了。",CAPTION_99e76bc35b9a94c7da2b602a2e8b25cc:"因为杨校长？",CAPTION_dd50a225efd057d146c5d0b307d1adbf:"不是。",CAPTION_6cf5d3e531ce9648cc0f6ac9fcaeb27a:"杨校长脾气我都摸清了，是新来的那个……",CAPTION_d27d8e369ccc0178648ccb144ac4a6a3:"李教官？",CAPTION_2c130c6fe98a050677b5e7320e1f4527:"嗯......她不吃我那一套，嗯......就那一套。",CAPTION_8163825c3b08311922c076ea34212622:"嗯，我明白。",CAPTION_fb55810a3d973d3398cb817ec8b982c2:"所以，我不知道你要搞什么大事，但是，你们肯定跟姓李的不是一路的，我加入你们。",CAPTION_3ba3c0bf672a29ef28b41795ab1287e0:"虽然......可能跟你想的不一样，但是也差不多。",CAPTION_3051bf350621ebede6619d696090fbac:"跟我说说，你们都有谁，准备怎么搞？",CAPTION_f1f821944bf6339dfa01f32735663fd1:"现在不行，你也别打听，回头啊等我找你。我还有事啊。",CAPTION_f1c0073b921294834d096fdf1ccff505:"唉？不是你......",CAPTION_c