ION_70edc1d94b0718ec13cc68e8005ae7a7:"不就兩盆花嘛，明天搬到校長辦公室不就行了。 ",CAPTION_4fef1c6453ba620c15c9b33f1b2981cf:"他說今天放校長室門口，明天搬進去，那就得按他說的來。別以為他不在就能隨便糊弄，他可什麼都能知道。 ",CAPTION_402326fcdf4216daf3183528482cb56a:"好好好。楊校長就是神仙行了吧？ ",CAPTION_d73ad5b20dd129958409ec6c07e6ee26:"哎呀，為了你好，別心不在焉的，你記住楊校長的要求沒有？ ",CAPTION_070ab46b8c890f1e08c448408bf33a2d:"今天放門口，",CAPTION_65f5d2db4c526c83418fbcd31d272205:"明天搬進去",CAPTION_81197c2d02b3a7c54cbd498ce55a73c8:"。 ",CAPTION_d889b904e02e8198f3ba39d0b0efe925:"這還差不多，實話告訴你，只有像我這樣的，才能在學校裡混下去。 ",CAPTION_0fc60e4f24e9b5b15618e0b0a84ec4b4:"我不就抱怨一句嘛，把你嚇的。 ",CAPTION_fee6438670d2705bb9e60e5ce73c440b:"隔牆有耳。 ",CAPTION_80b73fc347498e73cd92bf1a16a79815:"得了吧你。 ",CAPTION_762f95a4adb6b6f1eec6ebf7cab659bf:"哎呀，走了走了，趕緊搬到校長室門口就完事了。 ",CAPTION_94612b4175c8b56877c2a13d8d071f43:"搬東西的聲音",CAPTION_5cc2678c8c8f6bf01b9523dc626f5cad:"米醫生我走了。 ",CAPTION_e0cae0550616b7781db24b1185ae7015:"米醫生，我們今天什麼安排？ ",CAPTION_abb8c8fd5058130247ade101638135be:"現在沒什麼了，你休息一下。 ",CAPTION_a933af7831eba1c5b841fbf986725a16:"我不累。您讓我做點什麼吧。 ",CAPTION_eac6bd7711848db32ae6190396444bcc:"那上午就收拾一下醫務室，打掃打掃。 ",CAPTION_95532f336cab90c6d0c6e826195fda39:"好！我中午前會打掃好的。 ",CAPTION_957fb38984d6c2d5c103f69074978643:"那......下午......",CAPTION_db1cece21fc569eaf185e28ff0705abe:"下午你也別過來了，李教官說要來找我。 ",CAPTION_e3fb5d703836fb6ad39296fc8933a329:"嗯。明白了 。 ",CAPTION_4cff45b47a49212617175baeee84e873:"嗯，我出去一下，一會回來。 ",CAPTION_2676938f948c99d994866dfafe93c948:"你打掃完就可以回去了。 ",CAPTION_4e87ad4d7a13f2340003d8f71e8bfa34:"米醫生再見。 ",CAPTION_f461c324937082cdfe9c658f8411bb5a:"關門聲。 ",CAPTION_62181a3b7f96780e81b7c41cbc007d48:"打掃聲。 ",CAPTION_487e538b632e2b75ef027b072201aae7:"楊校長好，阿姨好。 ",CAPTION_2625a7169690efab411cbe53a3f23024:"吳菲媽媽，不用擔心，孩子我仔細看了，肯定能給你治好，你放心。 ",CAPTION_3aebf6d2baf6e2a168144608c358e754:"太謝謝您了，要不是您，我們真不知道怎麼辦。你說她，好好的學不上，非去跳什麼街舞。 ",CAPTION_3a48f838c70c98921bef1cdfb8ff0206:"跳舞什麼的，本來沒什麼錯。 ",CAPTION_641bb29de33b23a46e34df48ef851096:"您剛才不是說……",CAPTION_01ac0eb831cda1616037b3e30d4cd857:"跳舞是一種愛好，本身沒錯，但是不該成為孩子逃避責任的藉口。 ",CAPTION_a6ffde9d0f070634d9e9b4e8a4434